import React from 'react';
import Header from "./Header";
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Container, Row, Col
} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col><Header /></Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
